import React from 'react'
import portrait from '../../static/portrait.png'

const profilePicture = () => {
  return(
    <div>
      <div className="card z-depth-0 profile-picture">
        <img src={portrait} alt="profile"/>
      </div>
    </div>
  )
}

export default profilePicture
